import React, {
    Component
} from 'react';
import Breadcrumb from '../../master/main/breadcrumb';
import { Button } from 'antd';
import { AiOutlinePlus } from "react-icons/ai";

class Header extends Component {
    render() {
        return(
            <section className="buttonaction buttonaction--layout">
                <Breadcrumb>Phân tích và tìm kiếm tệp khách hàng</Breadcrumb>
                <div className="keyword_suggest_wrapper">
                    <div className="keyword__container d-flex align-items-center">
                        <div className="keyword__label">Tệp khách hàng gợi ý: </div>
                        <div className="keyword__items d-flex flex-1">
                            <div className="keyword__item">#Khách hàng mua sản phẩm giảm cân</div>
                            <div className="keyword__item">#Khách hàng có địa chỉ quận đống đa</div>
                            <div className="keyword__item">#Khách hàng có địa chỉ quận đống đa</div>
                            <div className="keyword__item">#Khách hàng có địa chỉ quận đống đa</div>
                            <div className="keyword__item">#Khách hàng có địa chỉ quận đống đa</div>
                            <div className="keyword__item">#Khách hàng có địa chỉ quận đống đa</div>
                            <div className="keyword__item">#Khách hàng có địa chỉ quận đống đa</div>
                        </div>
                        <div className="keyword__buttons">
                            <Button type="dashed" icon={<AiOutlinePlus />}>Tạo mới</Button>
                        </div>
                    </div>
                </div>
            </section>
        );
    }
}


export default Header;
